con:testSuite.con:setupScript:
import com.eviware.soapui.impl.wsdl.teststeps.*;
import com.eviware.soapui.support.types.*;

StringToStringMap headers=new StringToStringMap();
headers.put("username","meveo.admin");
headers.put("password","meveo.admin");

for( testCase in testSuite.getTestCaseList() ) {
   log.info("Setting authentication headers for WSDL test requests in test case ["+
             testCase.getLabel()+"]")
  for( testStep in testCase.getTestStepList() ) {
    if( testStep instanceof WsdlTestRequestStep ) {
      testStep.getTestRequest()
              .setRequestHeaders(headers);
    }
  }
}
